import numpy

class Solution:
    def maxVowels(self, s: str, k: int) -> int:
        vowels = ['a', 'e', 'i', 'o', 'u']
        ss = list(s)
        n = len(ss)
        res = ((numpy.isin(ss[:k], vowels)) == True).sum()
        most = res
        if res == k:
            return k

        for i in range(k, n):
            if ss[i] in vowels:
                res+=1
            if ss[i-k] in vowels:
                res -=1
            most = max(most, res)
            if most == k:
                return k
        return most


def main():
    """Solution."""
    sol = Solution()
    s1 = "abciiidef"
    k1 = 3  # 3
    s2 = "aeiou"
    k2 = 2  # 2
    s3 = "leetcode"
    k3 = 3 # 2
    s4 =   ""
    k4 = 3945 # 823
    print("Answer:", sol.maxVowels(s1, k1), "(3)")
    print("Answer:", sol.maxVowels(s2, k2), "(2)")
    print("Answer:", sol.maxVowels(s3, k3), "(2)")
    print("Answer:", sol.maxVowels(s4, k4), "(823)")
    

if __name__ == '__main__':
    main()
